                    <h2 class="news-detail__announce"><p>Сегодня с Проксимы вернулась этнографическая экспедиция Джона Голдрама.</p></h2>
                    <img class="news-detail__img hidden-img" src="/assets/images/newsPhoto/" alt="newsPhoto">   
                    <div class="news-detail__content">
                        <p>Сегодня с Проксимы вернулась этнографическая экспедиция под управлением профессора Джона Голдрама из Майхартского университета. Экспедиция работала в джунглях Туманного континента и занималась изучением неконтактного племени двухвостых зюзюмов.</p><p>"Это племя называет себя Ракатука-Тум-Тум и крайне неохотно контактирует с пришельцами", - сказал Джон Голдрам. На вопрос о том, каковы они - неконтактные зюзюмы, профессор заявил, что неконтактные зюзюмы такие же двухвостые и скандальные как и контактные, только неконтактные.</p><p>Ждем от профессора Голдрама новых интересных подробностей!</p>                    </div>

